import React, { Component } from 'react';

import shirt1 from '../images/shirt1.png'
import shirt2 from '../images/shirt2.png'
import shirt3 from '../images/shirt3.png'



const productData = [
	{
		name:"Men's Knitwear Offers",
		image:shirt1
	},
	{
		name:"Mens Sweat Shirt",
		image:shirt2
	},
	{
		name:"Mens Sweat Shirt",
		image:shirt3
	},

]

class Products extends Component {

	render(){

		const products = productData.map(product => {
			return (
				<div className='col-4 text-center' style={{marginBottom:'16px'}} key={product.name}>
					<div style={{backgroundColor:'white', minHeight:'192px'}}>

						<div style={{padding:'16px'}}>
							<img style={{width:'100%'}} src={product.image}/>
						</div>

						<div style={{padding:'16px'}}>
							<h6><strong>{product.name}</strong></h6>
						</div>

						<div style={{padding:'16px'}}>
							<button className='btn btn-sm btn-danger'>Buy Now</button>
						</div>

					</div>
				</div>
			)
		});

		return(
	     	<div className='row'>
	     		{products}
	     		{products}
	     	</div>
		);
	}
}


export default Products;
